import React from "react";
import IndividualInvoice from "./IndividualInvoice";

const Invoice = (props) => {

        if(props.data === null) {
            return <h1>Cannot fetch data</h1>
        }
        return (
            <>
                <div className="container bg-light mt-5 rounded p-2 shadow" style={{maxwidth: "700px"}}>
                    <h4 className="display-4 px-3 fw-bold">Invoices</h4>
                    {}
                    {props.data.invoices.map(invoice => {
                    <IndividualInvoice 

                    key={invoice._id}
                    name={invoice.name}
                    dueDate={invoice.dueDate}
                    billNo={invoice.billNo}
                    billDate={invoice.billDate}                   
                    grossAmount={invoice.grossAmount}
                    netAmount={invoice.netAmount}
                    notes={invoice.notes}
                    status={invoice.status}
                    createdAt={invoice.createdAt}
                    updatedAt={invoice.updatedAt}

                    // prodId={invoice.lineItem._id}
                    // productName={invoice.lineItem.productName}
                    // quantity={invoice.lineItem.quantity}
                    // price={invoice.lineItem.price}
                    // amount={invoice.lineItem.amount}
                    // gstRate={invoice.lineItem.gstRate}

                    />})}

                </div>
            </>
        )
}

export default Invoice;
